import React from "react";
import Navbar from "./components/NavBar/navbar";
import Intro from "./components/Intro/intro";
import Skill from "./components/Skills/skill";
import {
    BrowserRouter as Router,
    // Routes,
    // Route,
} from "react-router-dom";
function App() {
    return (
        <div className="App">
            <Router>
                <Navbar />
                <Intro />
            </Router>
        </div>
    )
}
export default App;
